import styled from "styled-components";

export const CardListContainer = styled.div`
    width: 85vw;
    margin: 0 auto;
    display: grid;
    grid-template-columns: repeat(auto-fit, minmax(275px, 1fr));
    grid-gap: 2em;
    justify-content: center;
    align-items: center;

`
